import { Link } from "react-router-dom";
import StockManagerSelector from "./sub_component/StockManagerSelector";

const NavBar = () => {
    return (
        <div>
            <nav>
                <h2>Inventory Manager</h2>

                <Link to="/" style={{ 'padding': '15px',
                                      'textDecoration': 'none',
                                      'borderRadius': '20%',
                                      'background-color': 'rgb(250, 250, 250)' }}>Dashboard</Link>
                <Link to="contact" style={{ 'padding': '15px',
                                      'textDecoration': 'none',
                                      'borderRadius': '20%',
                                      'background-color': 'rgb(250, 250, 250)' }}>Contact</Link>

                <StockManagerSelector />
            </nav>
        </div>
    );
}

export default NavBar;
